import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
let lakesList = ["hidden", "angura", "tahoe"];

function Lakes(props) {
  return (
    <h1>{props.lake}</h1>
  );
}

function App(props) {
  return (
    <div>
      {props.lakes.map(lake => {<li>
        {lake}
      </li>})}
    </div>
  )
}

ReactDOM.render(
  <App lakes={lakesList} />,
  document.getElementById('root')
);
